function initCardManager(E){window.addEventListener("load",()=>{initTable({FIELDS_FETCH:["id","memo","image_id","image_name","image_url","status","status_name","sequence"],FIELDS_TABLE:[{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"id"},{CONTENT_TYPE:CONTENT_TYPES.LINK,CONTENT_FIELD:"item.memo",CONTENT_FIELD_STICKY:"true",CONTENT_FIELD_EXTRA:getCardTranslationUrl("item.id")},{CONTENT_TYPE:CONTENT_TYPES.LINK,CONTENT_FIELD:"item.image_name",CONTENT_FIELD_EXTRA_HASH:'"content-modal"',CONTENT_FIELD_EXTRA_END:'data-bs-toggle="modal"',CONTENT_FIELD_EXTRA_ONCLICK:'"setModalContent(`" + encodeURIComponent(item.image_name) + "`,`" + encodeURIComponent(item.image_url) + "`)"'},{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"status_name"},{CONTENT_TYPE:CONTENT_TYPES.TEXT,CONTENT_FIELD:"sequence"},],FIELDS_TABLE_HEADER:["",E.MSG_MEMO,E.MSG_IMAGE,E.MSG_STATUS,E.MSG_SEQUENCE],FIELDS_TABLE_ORDERBYS:["",E.ORDER_MEMO,E.ORDER_IMAGE,E.ORDER_STATUS,E.ORDER_SEQUENCE],RADIO_SHOW_BUTTON_IDS:["btn-modify","btn-delete"],noMove:!1})})}function setModalContent(E,T){document.querySelector("#content-modal-header").innerHTML=decodeURIComponent(E),document.querySelector("#content-modal-body").src=decodeURIComponent(T)}function getCardTranslationUrl(E){return"'/cardTranslations/conditions={&quot;cardId&quot;:&quot;' + "+E+" + '&quot;}'"}